import React, { Component } from 'react';
import '../styles/denied-component/denied.css';
import Denied from '../assets/svg/denied.svg';

class LoanDenied extends Component {

  render() {
    return (
        <div className='loan-denied'>
            Sorry!!!
        </div>
    );
  }
}

export default LoanDenied;
